description:
Category	All Girl, Girl-Girl, Lesbian, Sweetheart Video's Lesbian Truth Or Dare Series

Director	Nica Noelle
Starring	Dani Daniels, Dana Vespoli, London Keys, Lily Labeau, Aiden Starr, Sovereign Syre, Kara Price

Featuring: Kara Price &amp; Dani Daniels! We dare you to not fall head over heels for these lesbian beauties, because they're passion for female sexuality is an undeniable truth. Sweetheart Video returns once more with Lesbian Truth Or Dare 7. The girls gather for a small get-together and as the snacks and drinks get underway, so do curiosities and secret desires. Always pushing the boundaries between lust and love, craving and satisfaction, the Truth Or Dare series remains one of the most beloved series in lesbian lovemaking. Written and directed by Nica Noelle!

